script: |
  super -f text -I q7560.spq | sort > q7560.out

inputs:
  - name: q7560.spq
    data: |
      SELECT ALL + - col2 * + 36 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT ( ( NOT ( NOT NULL BETWEEN - col0 * - ( col0 ) + - + ( col1 ) AND + 1 * - + col0 ) ) );
  - name: tab1

outputs:
  - name: q7560.out
    data: |
